import React from 'react';

export class Testing extends React.Component{
    constructor(props){
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(){
        this.props.boxClick;
      }
    
    render(){
        return(
            <div onClick={this.handleClick}>
                <p onClick={this.handleClick}>click click click</p>
            </div>
        )
    }
}
